import React from 'react'
import { withFormik, Form, Field } from 'formik';
import * as yup from 'yup'


const Person = (props) => {
    return (
      <Form>
        <Field type='text' name='somethng' placeholder='name'> </Field> 
      </Form>
    )
    }

  export default withFormik ({
      mapPropsToValues: () => {} 
  })(Person)
